import React from "react";
import { Section, Icons, IconOne } from "./FooterElements";
import {
  FaChartLine,
  FaClinicMedical,
  FaCheckCircle,
  FaUser
} from "react-icons/fa";

function Footer() {
  return (
    <Section>
      <Icons>
        <IconOne>
          <FaClinicMedical />
          <p>Home</p>
        </IconOne>
        <IconOne>
          <FaChartLine />
          <p>Monitor</p>
        </IconOne>
        <IconOne>
          <FaCheckCircle />
          <p>Healthcheck</p>
        </IconOne>
        <IconOne>
          <FaUser />
          <p>Me</p>
        </IconOne>
      </Icons>
    </Section>
  );
}

export default Footer;
